	function run_strike_bb(input, output){
		currenteditor = jQuery(".strike-wysiwyg-enable").attr("rel");

		if(currenteditor == "wys-current"){
			input = input.replace(/<br \/>/mg,"<br>");
			input = input.replace(/<br\/>/mg,"<br>");
			input = input.replace(/<br>/mg,"<br>");
			output.html(input);
		}else{
			output.html(input);
		}
		return true;
	}


